(13, 12, 7, '', '', 0, 'tamilnadu-police-youth-brigade-recruitment-2013', 'Tamilnadu Police Youth Brigade Recruitment 2013', '<p style="margin: 0px 0px 1.5em; font-family: Georgia, ''Times New Roman'', ''Bitstream Charter'', Times, serif; line-height: 19px;">Tamil Nadu Uniformed Services Recruitment Board (TNUSRB) has announced the 10500 vacancies for TN Special Youth Brigade (Male). All Eligible candidates have to apply via prescribed format of application before 1st October, 2013.</p>\r\n\r\n<p style="margin: 0px 0px 1.5em; font-family: Georgia, ''Times New Roman'', ''Bitstream Charter'', Times, serif; line-height: 19px;">Total vacancies: 10500<br />\r\nName of Post: Youth Brigade (Male)<br />\r\nAge Limit: Less than 25 years as on 01.01.2013<br />\r\nQualification: 10th/12th from any recognized board or Institution<br />\r\nApplication Fee: Rs 100/-<br />\r\nMethod of Selection: Selection through written test and physical Fitness.</p>\r\n\r\n<p style="margin: 0px 0px 1.5em; font-family: Georgia, ''Times New Roman'', ''Bitstream Charter'', Times, serif; line-height: 19px;">Last date for receipt of application: 1st October, 2013.</p>\r\n\r\n<p style="margin: 0px 0px 1.5em; font-family: Georgia, ''Times New Roman'', ''Bitstream Charter'', Times, serif; line-height: 19px;">How to Apply?</p>\r\n\r\n<p style="margin: 0px 0px 1.5em; font-family: Georgia, ''Times New Roman'', ''Bitstream Charter'', Times, serif; line-height: 19px;">Download application form official website at www.tnusrb.tn.gov.in and fill the application form with proper details. Then after send it to the respective address given in the notification for the applied posts.</p>\r\n\r\n<p style="margin: 0px 0px 1.5em; font-family: Georgia, ''Times New Roman'', ''Bitstream Charter'', Times, serif; line-height: 19px;">Visit the link below for download official Notfication and Application Form</p>\r\n\r\n<p style="margin: 0px; font-family: Georgia, ''Times New Roman'', ''Bitstream Charter'', Times, serif; line-height: 19px;">http://www.tnpolice.gov.in/youth_brigade.html</p>', 'ntutorial_page961486.jpg', 'Tamilnadu Police Special Youth Brigade Recruitment 2013', 'Tamilnadu Police Youth Brigade Recruitment 2013', 'youth brigade recruitment,recruitment 2013,police recruitment', '2013-09-26', 1),
(14, 11, 7, 'Railway Jobs', '', 0, 'railway-jobs', 'Railway Jobs', '<p>Find all railway jobs here.</p>', '', 'Railway Jobs', 'Railway jobs in Indian government', 'railway jobs,sarkari naukari,government jobs', '2013-09-26', 1),
(15, 14, 7, '', '', 0, 'rrc-secunderabad-recruitment-2013', 'RRC Secunderabad Recruitment 2013', '<p style="margin: 0px 0px 1.5em; font-family: Georgia, ''Times New Roman'', ''Bitstream Charter'', Times, serif; line-height: 19px;">Railways Recruitment Cell (RRC) South Central Railway (SCR) Secunderabad has announced the recruitment of Track man, Helper-II and Assistant Points Man Posts with 2801 vacancies.</p>\r\n\r\n<p style="margin: 0px 0px 1.5em; font-family: Georgia, ''Times New Roman'', ''Bitstream Charter'', Times, serif; line-height: 19px;"><strong>Total Vacancies :</strong>&nbsp;2801</p>\r\n\r\n<p style="margin: 0px 0px 1.5em; font-family: Georgia, ''Times New Roman'', ''Bitstream Charter'', Times, serif; line-height: 19px;"><strong>Name of Posts :</strong><br />\r\nTrackman : 1979 Posts<br />\r\nHelper-II : 440 Posts<br />\r\nAssistant Points Man : 382 Posts</p>\r\n\r\n<p style="margin: 0px 0px 1.5em; font-family: Georgia, ''Times New Roman'', ''Bitstream Charter'', Times, serif; line-height: 19px;"><strong>Age Limit:</strong>&nbsp;Between 18 to 33 years.</p>\r\n\r\n<p style="margin: 0px 0px 1.5em; font-family: Georgia, ''Times New Roman'', ''Bitstream Charter'', Times, serif; line-height: 19px;"><strong>Qualification :</strong>&nbsp;10th or ITI or equivalent from any Recognized Board.</p>\r\n\r\n<p style="margin: 0px 0px 1.5em; font-family: Georgia, ''Times New Roman'', ''Bitstream Charter'', Times, serif; line-height: 19px;"><strong>Application Fee :</strong><br />\r\nSC/ST, Women, Minority Communities, Economically Backward Classes, PWD Category candidates are exempted from any Application form payment fee.<br />\r\nFor General and OBC Category : Rs. 100 /-</p>\r\n\r\n<p style="margin: 0px 0px 1.5em; font-family: Georgia, ''Times New Roman'', ''Bitstream Charter'', Times, serif; line-height: 19px;"><strong>Last Date for receipt of Application form :</strong>&nbsp;30.09.2013.<br />\r\n<strong>Last Date for receipt of Application form (far flung areas) :</strong>&nbsp;15.10.2013.</p>\r\n\r\n<p style="margin: 0px 0px 1.5em; font-family: Georgia, ''Times New Roman'', ''Bitstream Charter'', Times, serif; line-height: 19px;"><strong>How to Apply?</strong><br />\r\nFirst download application form which is available on Indian railway official website at www.scr.indianrailways.gov.in, then fill it with all the mandatory details along with photograph, signature and certificates then send it to following address by ordinary post-<br />\r\nThe Assistant Personnel Officer/RRC/SC,<br />\r\nWritten Examination Control Centre,<br />\r\nRailway Bunglow No.100, Opp.St.Anthony&rsquo;s Church,<br />\r\nBeside Mettuguda Bus Stop,South Lallaguda,<br />\r\nSecunderabad (A.P)-500017.</p>\r\n\r\n<p style="margin: 0px 0px 1.5em; font-family: Georgia, ''Times New Roman'', ''Bitstream Charter'', Times, serif; line-height: 19px;">You can download the application format and detail from below link-</p>\r\n\r\n<p style="margin: 0px; font-family: Georgia, ''Times New Roman'', ''Bitstream Charter'', Times, serif; line-height: 19px;">http://203.153.33.92/rrc_web/E.Notification%202013%20PDF/Employment%20notification%202013.pdf</p>', '', 'RRC Secunderabad Recruitment 2013', 'Railways Recruitment Cell (RRC) South Central Railway (SCR) Secunderabad has announced the recruitment of Track man, Helper-II and Assistant Points Man Posts with 2801 vacancies.', 'assistant jobs,govt jobs,helper jobs,railway jobs,recruitment 2013', '2013-09-26', 1),
(16, 11, 7, '', '', 0, 'up-panchayati-raj-recruitment-2013', 'UP Panchayati Raj Recruitment 2013', '<p style="margin: 0px 0px 1.5em; font-family: Georgia, ''Times New Roman'', ''Bitstream Charter'', Times, serif; line-height: 19px;">Uttar Pradesh (UP) Panchayati Raj Department has announced the 2900 vacancies for Gram Panchayat Adhikari posts. Eligible candidates have to apply through prescribed format of application before 07th October, 2013.</p>\r\n\r\n<p style="margin: 0px 0px 1.5em; font-family: Georgia, ''Times New Roman'', ''Bitstream Charter'', Times, serif; line-height: 19px;"><strong>Total vacancies:</strong>&nbsp;2900</p>\r\n\r\n<p style="margin: 0px 0px 1.5em; font-family: Georgia, ''Times New Roman'', ''Bitstream Charter'', Times, serif; line-height: 19px;"><strong>Name of post:</strong>&nbsp;Gram Panchayat Adhikari</p>\r\n\r\n<p style="margin: 0px 0px 1.5em; font-family: Georgia, ''Times New Roman'', ''Bitstream Charter'', Times, serif; line-height: 19px;"><strong>Age Limit :</strong>&nbsp;Between 18 to 40 years</p>\r\n\r\n<p style="margin: 0px 0px 1.5em; font-family: Georgia, ''Times New Roman'', ''Bitstream Charter'', Times, serif; line-height: 19px;"><strong>Qualification:</strong>&nbsp;12th form a recognized Board.</p>\r\n\r\n<p style="margin: 0px 0px 1.5em; font-family: Georgia, ''Times New Roman'', ''Bitstream Charter'', Times, serif; line-height: 19px;"><strong>Method of Selection:</strong>&nbsp;On the basis of Interview which will be held from 15 to 25 October, 2013 and Merit list.</p>\r\n\r\n<p style="margin: 0px 0px 1.5em; font-family: Georgia, ''Times New Roman'', ''Bitstream Charter'', Times, serif; line-height: 19px;"><strong>How to Apply?</strong><br />\r\nDownload application format from www.panchayatriraj.up.nic.in. After that send Application Form through registered post only.</p>\r\n\r\n<p style="margin: 0px 0px 1.5em; font-family: Georgia, ''Times New Roman'', ''Bitstream Charter'', Times, serif; line-height: 19px;"><strong>Last date to send the Application Form :</strong>&nbsp;07.10. 2013.<br />\r\n<strong>Candidates will be Informed for Interview :</strong>&nbsp;15th to 25th October, 2013.<br />\r\n<strong>The merit list will be published :</strong>&nbsp;08th to 14th October, 2013.<br />\r\n<strong>The Interview will be held on :</strong>&nbsp;06th to 30th November, 2013.</p>\r\n\r\n<p style="margin: 0px; font-family: Georgia, ''Times New Roman'', ''Bitstream Charter'', Times, serif; line-height: 19px;">Download Official Notification and Application form here<br />\r\nhttp://panchayatiraj.up.nic.in/</p>', '', 'UP Panchayati Raj Recruitment 2013', 'Uttar Pradesh (UP) Panchayati Raj Department has announced the 2900 vacancies for Gram Panchayat Adhikari posts. Eligible candidates have to apply through prescribed format of application before 07th October, 2013.', 'govt jobs,recruitment 2013,sarkari naukari', '2013-09-26', 1),
(17, 11, 7, '', '', 0, 'bccl-recruitment-2013-for-diploma-engineers', 'BCCL Recruitment 2013 for Diploma Engineers', '<p style="margin: 0px 0px 1.5em; font-family: Georgia, ''Times New Roman'', ''Bitstream Charter'', Times, serif; line-height: 19px;">Bharat Coking Coal Limited (BCCL) subsidiary of Coal India Limited a Maharatna Company has announced the recruitment of 472 vacancies for Diploma Engineering jobs of Jr. Overman, Mining Sirdar and Surveyor (Mining).</p>\r\n\r\n<p style="margin: 0px 0px 1.5em; font-family: Georgia, ''Times New Roman'', ''Bitstream Charter'', Times, serif; line-height: 19px;"><strong>Total vacancies :</strong>&nbsp;472</p>\r\n\r\n<p style="margin: 0px 0px 1.5em; font-family: Georgia, ''Times New Roman'', ''Bitstream Charter'', Times, serif; line-height: 19px;"><strong>Name of posts :</strong><br />\r\nJr. Overman : 142 Posts<br />\r\nMining Sirdar : 317 Posts<br />\r\nSurveyor (Mining) : 13 Posts</p>\r\n\r\n<p style="margin: 0px 0px 1.5em; font-family: Georgia, ''Times New Roman'', ''Bitstream Charter'', Times, serif; line-height: 19px;"><strong>Age Limit:</strong>&nbsp;Between 18 to 30 years as on 10.10.2013.</p>\r\n\r\n<p style="margin: 0px 0px 1.5em; font-family: Georgia, ''Times New Roman'', ''Bitstream Charter'', Times, serif; line-height: 19px;"><strong>Qualification:</strong><br />\r\nDiploma in Mining Engineering of 3 years duration from recognized institute and Valid Overman&rsquo;s Certificate of Competency issued by DGMS for Junior Overman Post.<br />\r\nValid Mining Sirdar&rsquo;s Certificate issued by DGMS and Valid Gas Testing Certificate for Mining Sirdar Post.<br />\r\nMatriculation from any recognized Board and Valid Surveyors Certificate of Competency issued by DGMSf for Surveyor (Mining) post.</p>\r\n\r\n<p style="margin: 0px 0px 1.5em; font-family: Georgia, ''Times New Roman'', ''Bitstream Charter'', Times, serif; line-height: 19px;"><strong>Application Fee :</strong><br />\r\nFor General/OBC Candidates : Rs. 100/-.<br />\r\nSC/ST Candidates are not required to pay fee.</p>\r\n\r\n<p style="margin: 0px 0px 1.5em; font-family: Georgia, ''Times New Roman'', ''Bitstream Charter'', Times, serif; line-height: 19px;">Selection Method : On the basis of performance in Written Examination and Interview.</p>\r\n\r\n<p style="margin: 0px 0px 1.5em; font-family: Georgia, ''Times New Roman'', ''Bitstream Charter'', Times, serif; line-height: 19px;">Last date for receipt of application: 10th October, 2013.</p>\r\n\r\n<p style="margin: 0px; font-family: Georgia, ''Times New Roman'', ''Bitstream Charter'', Times, serif; line-height: 19px;"><strong>How to Apply?</strong><br />\r\nDownload Application format from BCCL website at www.bccl.gov.in then send properly filled prescribed Application Form only through Registered/Speed Post in a sealed envelope addressed to -<br />\r\nThe General Manager (Recruitment),<br />\r\nBharat Coking Coal Limited, Koyla Bhawan,<br />\r\nKoyla Nagar, Post- BCCL Township,<br />\r\nDhanbad, Jharkhand, PIN- 826005.<br />\r\nDownload full official notification from below link-<br />\r\nhttp://www.bccl.gov.in/newpdfs/overman.pdf</p>', 'ntutorial_page178009.jpg', 'BCCL Recruitment 2013 for Diploma Engineers', 'BCCL Recruitment 2013 for Diploma Engineers', 'govt jobs,recruitment 2013,sarkari naukari,bccl recruitment', '2013-09-26', 1);
